  true,\n\t\"url\": null,\n\t\"notes\": \"As part of the Obama administration's work
  to make our health care system more affordable and accountable, data are being released
  that show significant variation across the country and within communities in what
  providers charge for common services. These data include information comparing the
  charges for the 100 most common inpatient services and 30 common outpatient services.
